import { Fragment } from "react";
import Head from "next/head";

// components
import Header from "../components/header/header.component";

const Index = () => {
  return (
    <Fragment>
      <Head>
        <title>Bitcoin Price</title>
      </Head>
      <Header />
      <h1>This is Home Page</h1>
    </Fragment>
  );
};

export default Index;
